import React from "react";

import '../Css/ProyectosRND.css';

function ProyectosRND(){
  return(
    <div>
      <div className='contenedor-experimentos'>
        <div className='texto-color-random'>
              <label >1.1</label>
        </div>
        
        <div className='cara-o-sello'>
              <label> Lorem ipsum dolor sit amet consectetur, adipisicing elit. Dolores itaque recusandae cum facilis hic commodi, quae excepturi, sapiente at blanditiis provident. Id voluptates necessitatibus deserunt impedit vero? Enim, vero! Aliquid.</label>
        </div>

        <div className='gato-rpg'>
        <label >2.0</label>
        </div>

        <div className='imagen-random-gatoAPI'>
        <label >3.0</label>
        </div>

        <div className='chat'>
        <label >4.0</label>
        </div>
      </div>
    </div>
  );
};

export default ProyectosRND;
